import React from 'react'

import classes from './Button.css'

const button = ( props ) => {

    return (<div className="drum-pad" id={props.id}>
            <audio
                className="clip"
                id={props.value}
                src={props.src}
                ref={ref => this.audio = ref}/>
            {props.value}
        </div>
    );
};
export default button;
